const CustomizedTables = ({ StyledTableRow, StyledTableCell, item }) => {
  const ddd = item;
  console.log("tttt : ", ddd);
  console.log("ttttmmmm : ");
  return (
    <div>
      <StyledTableRow>
        <StyledTableCell component="th" scope="row">
          {item.selling_quantity}
        </StyledTableCell>
        <StyledTableCell align="left">{item.selling_amount}</StyledTableCell>
        <StyledTableCell align="left">{item.currency}</StyledTableCell>
        <StyledTableCell align="left">{item.buying_price}</StyledTableCell>
        <StyledTableCell align="left">{item.buying_quantity}</StyledTableCell>
        <StyledTableCell align="left">{item.buying_amount}</StyledTableCell>
        <StyledTableCell align="left">{item.insert_date}</StyledTableCell>
      </StyledTableRow>
    </div>
  );
};

export default CustomizedTables;
